trailingComments.value:
*
 * navigation 改变刷新背景颜色
 *
 * 支持平台：书旗Android、书旗iOS
 *
 * @param {String} color 颜色代码，例 #98d7a1
 * @returns {Promise<Object>}
 *
 * @example
 * libSQ.exec('set-curimgcolor', {
 *   params: {
 *     color: '#98d7a1',
 *   },
 * }).then((info) => {
 *   console.log(`[set-curimgcolor][then] ${JSON.stringify(info, null, 2)}`);
 * }).catch((err) => {
 *   alert(`[set-curimgcolor][error] ${JSON.stringify(err, null, 2)}`);
 * });

